// src/pages/UserDashboard.js
import React from 'react';
import { Link, Outlet } from 'react-router-dom';

const UserDashboard = () => {
  return (
    <div className="min-h-screen flex flex-col md:flex-row bg-gray-100">
      {/* Sidebar */}
      <aside className="w-full md:w-1/4 bg-white shadow-md p-6">
        <h2 className="text-xl font-bold mb-4">My Luxor</h2>
        <nav className="flex flex-col space-y-4">
          <Link to="/dashboard/wishlist" className="hover:text-black text-gray-700">Wishlist</Link>
          <Link to="/dashboard/orders" className="hover:text-black text-gray-700">Order History</Link>
          <Link to="/dashboard/account" className="hover:text-black text-gray-700">Account Details</Link>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="flex-1 p-6">
        <Outlet />
      </main>
    </div>
  );
};

export default UserDashboard;
